  render() {
    return (
      <section className="comments">
        <div className="comments-container">
          <span className="comments-container__commentcount">3 Comments</span>
          <span className="comments-container__join">
            JOIN THE CONVERSATION
          </span>
          <div className="comments-container__join"></div>
        </div>
      </section>
    );
  }
}
